def _getStructureInfo(mode="schematic"):
    full_list = []
    for structureType in _structureTypes:
        structure_list = _structureTypes[structureType]
        for i in range(len(structure_list)):
            item = structure_list[i].get(mode)
            if item is not None:
                full_list.append(item)
            elif mode == "schematic" or mode == "schem":
                schematic = _getSchematic(structureType, i)
                full_list.append(schematic)
            elif mode == "probability" or mode == "prob":
                full_list.append(structure_list[i]["probability"])
            elif mode == "data":
                full_list.append(structure_list[i]["data"])
            elif mode == "blocks" or mode == "block":
                full_list.append(structure_list[i]["blocks"])
            elif mode == "entrance" or "ent":
                full_list.append(structure_list[i]["entrance"])
            elif mode == "shape":
                full_list.append(structure_list[i]["shape"])
            elif mode == "name":
                full_list.append(structure_list[i]["name"])
    return full_list


