def getShapeList():
    return _getStructureInfo("shape")


def getEntranceList():
    return _getStructureInfo("entrance")


def getNameList():
    return _getStructureInfo("name")


def makeSchematic(shape, blocks, data, rotation = 0):
    try:
        shape_iterator = iter(shape)
    except TypeError as ex:
        print ("Shape is not iterable. Given shape: " + str(shape))
    if len(shape) != 3:
        raise ValueError("Invalid shape: " + str(shape))
    for i in shape:
        if type(i) != int:
            raise TypeError("All elements of shape must be int. Given shape: " + str(shape))
    schematic = MCSchematic(shape=shape, filename='')
    schematic._Blocks = blocks
    schematic.root_tag['Data'] = pymclevel.nbt.TAG_Byte_Array(data)
    rot = int(rotation % 4)
    for i in range(rotation):
        schematic.rotateLeft()
    return schematic


def _getSchematic(structure_set, structure_key):
    if type(structure_set) != str:
        raise TypeError("Error: Structure set must be a string. Given type: " + str(type(structure_set)))
    try:
        key = int(structure_key)
    except Exception as ex:
        print("Error: Structure key must be an int or int convertible. Given type: " + str(type(structure_key)))
        if type(structure_key) == str:
            print("String value: " + structure_key)
        raise ex
    structure_list = _structureTypes.get(structure_set)
    if structure_list is None:
        raise ValueError("Invalid structure set: " + structure_set)
    if key >= len(structure_list):
        raise KeyError("Key given: " + str(key) \
                       + ", Length of list of " + structure_set + " structures: " + str(len(structure_list)))
    structure = structure_list[key]
    if structure.get("shape") is None:
        raise KeyError("Invalid structure key for type " + structure_set + ": " + str(key))
    schematic = MCSchematic(shape=structure["shape"], filename='')
    schematic._Blocks = structure["blocks"]
    schematic.root_tag['Data'] = pymclevel.nbt.TAG_Byte_Array(structure["data"])
    return schematic
